import { Layout } from "antd";

const { Header, Content, Footer } = Layout;

function App() {
  return (
    <Layout style={{ height: "100vh" }}>
      <Header>Header</Header>
      <Content
        style={{
          padding: "50px",
          maxHeight: "calc(100% - 64px)",
          overflow: "auto",
       }} 
      >Content</Content>
      <Footer>Footer</Footer>
    </Layout>
  );
}

export default App;
